<html>
<head>

<style type="text/css">
input[type=range] {
  height: 34px;
  -webkit-appearance: none;
  margin: 10px 0;
  width: 100%;
}
input[type=range]:focus {
  outline: none;
}
input[type=range]::-webkit-slider-runnable-track {
  width: 100%;
  height: 8px;
  cursor: pointer;
  animate: 0.2s;
  box-shadow: 0px 0px 0px #000000;
  background: #968E85;
  border-radius: 8px;
  border: 2px solid #FFFFFF;
}
input[type=range]::-webkit-slider-thumb {
  box-shadow: 1px 1px 0px #FFFFFF;
  border: 6px solid #7E317B;
  height: 21px;
  width: 21px;
  border-radius: 19px;
  background: #FFFFFF;
  cursor: pointer;
  -webkit-appearance: none;
  margin-top: -10.5px;
}
input[type=range]:focus::-webkit-slider-runnable-track {
  background: #968E85;
}
input[type=range]::-moz-range-track {
  width: 100%;
  height: 8px;
  cursor: pointer;
  animate: 0.2s;
  box-shadow: 0px 0px 0px #000000;
  background: #968E85;
  border-radius: 8px;
  border: 2px solid #FFFFFF;
}
input[type=range]::-moz-range-thumb {
  box-shadow: 1px 1px 0px #FFFFFF;
  border: 6px solid #7E317B;
  height: 21px;
  width: 21px;
  border-radius: 19px;
  background: #FFFFFF;
  cursor: pointer;
}
input[type=range]::-ms-track {
  width: 100%;
  height: 8px;
  cursor: pointer;
  animate: 0.2s;
  background: transparent;
  border-color: transparent;
  color: transparent;
}
input[type=range]::-ms-fill-lower {
  background: #968E85;
  border: 2px solid #FFFFFF;
  border-radius: 16px;
  box-shadow: 0px 0px 0px #000000;
}
input[type=range]::-ms-fill-upper {
  background: #968E85;
  border: 2px solid #FFFFFF;
  border-radius: 16px;
  box-shadow: 0px 0px 0px #000000;
}
input[type=range]::-ms-thumb {
  margin-top: 1px;
  box-shadow: 1px 1px 0px #FFFFFF;
  border: 6px solid #7E317B;
  height: 21px;
  width: 21px;
  border-radius: 19px;
  background: #FFFFFF;
  cursor: pointer;
}
input[type=range]:focus::-ms-fill-lower {
  background: #968E85;
}
input[type=range]:focus::-ms-fill-upper {
  background: #968E85;
}


</style>

  <div class="output_html rendered_html output_subarea output_execute_result">

      <script type="text/javascript">
        var mergeNodes = function(a, b) {
          return [].slice.call(a).concat([].slice.call(b));
        }; // http://stackoverflow.com/questions/914783/javascript-nodelist/17262552#17262552
        function interactUpdate(div){
           var outputs = div.getElementsByTagName("div");
           //var controls = div.getElementsByTagName("input");
           var controls = mergeNodes(div.getElementsByTagName("input"), div.getElementsByTagName("select"));
           function nameCompare(a,b) {
              return a.getAttribute("name").localeCompare(b.getAttribute("name"));
           }
           controls.sort(nameCompare);

           var value = "";
           for(i=0; i<controls.length; i++){
             if((controls[i].type == "range") || controls[i].checked){
               value = value + controls[i].getAttribute("name") + controls[i].value;
             }
             if(controls[i].type == "select-one"){
               value = value + controls[i].getAttribute("name") + controls[i][controls[i].selectedIndex].value;
             }
           }

           for(i=0; i<outputs.length; i++){
             var name = outputs[i].getAttribute("name");
             if(name == value){
                outputs[i].style.display = 'block';
             } else if(name != "controls"){
                outputs[i].style.display = 'none';
             }
           }
        }
      </script>
